COMMENTAIRE:
CERBÈRE - Le village le plus impliqué du parcours 🦀

Cette dernière récolte clôture la partie vélo du Projet Azur et ça a certainement été la plus impactante. Pas en kilos ramassés mais de part l'incroyable mobilisation de tous le village et acteurs publiques @reserve naturelle de banyuls , @conservatoiredulittoral , @conseil départemental 66, pour accueillir le projet Azur. Il y a un peu plus de 1000 habitants à Cerbère et nous étions plus d'une cinquantaine à ramasser ensemble ce dimanche. Les deux clubs de plongée @plongeecapcerbere et @aloes.plongee se sont démenés pour remonter un maximum de polluant de l'anse, les citoyens et le maire @christian grau lui même ont participé à fond sur ce ramassage. Tout le monde avait les mains dedans : enfants, ados, étudiants, parents, âgés, citoyens, élus @michel Moly, @daniel galy, scientifiques et eco gardes de la @reserve de Cerbère banyuls sur emr , @didier fioramonti, @frederic Cadène,...

Il y a eu une véritable implication de la ville de s'engager vers quelque chose de nouveau, s'orienter vers un tourisme plus durable et protéger davantage leurs magnifique territoire. Il faut dire qu'en plus de la magnifique côté rocheuse qui offre de superbes balades en hauteurs et des randonnées aquatiques très riches en poissons, ils ont aussi une super cuisine et un excellent vin 🥴

Je pourrai exposer le détail de la collecte mais s'il y a une info à retenir c'est que ce dimanche l'union à fait la force. Des passionnés qui aiment leur Mer et se démènent pour améliorer la cohésion et le bien être de leur concitoyens c'est un message porteur d'espoir pour un monde plus juste sur le plan social et environnemental.

J'ai été entendue et ce week-end a été riche en échange et découverte. C'est avec des implications locales qu'on va pouvoir faire un mouvement globale.

Merci à la mairie de Cerbère et les Cerbériens pour leur engagement, @la réserve de banyuls pour la découverte du sentier marin où j'ai pu observer des Mérous et une grande Nacre...



